import React from "react";
import "./Banner.scss";
import BannerImage from "./banner.jpg";

function Banner() {
  return (
    <div className="banner">
      <div className="banner-title"></div>
      <div className="banner-description"></div>
    </div>
  );
}

export default Banner;
